import { Card } from '../../shared/Card/Card';
import { Header } from '../../shared/Header/Header';
import { Jogos } from '../Jogos';
import './Home.css'

export const Home = () => {
    const jogos = Jogos;

    return (
        <section>
            <Header />
            <main>
                {jogos.map((card, index) => (
                    <Card
                        key={index}
                        img={card.img}
                        desconto={`${(card.desconto * 100)}%`}
                        precoOrig={card.precoOrig}
                        price={card.desconto * card.precoOrig}
                    />
                ))}
            </main>
        </section>
    );
}
